import React from "react";
import { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import axios from "axios";

function Playlist(props) {
  let [genres, setGenres] = useState([""]);

  useEffect(() => {
    axios
      .get("https://deezerdevs-deezer.p.rapidapi.com/genre/%7Bid%7D")
      .then((res) => {
        console.log(res.data);
        setGenres(res.data);
      });
  }, []);

  return (
    <div>
      <form name="cars" id="cars" multiple>
        <ul>
          <h3>Now that you've got your itinerary, what vibe are you going for?</h3>

          <div>
            <input
              type="radio"
              value="A"
            />
            <label>
              A) Computer Styled Sections{" "}
            </label>
          </div>

          <div>
            <input
              type="radio"
              value="B"
            />
            <label>B) Cascading Style Sheets</label>
          </div>

          <div>
            <input
              type="radio"
              value="C"
            />
            <label>C) Crazy Solid Shapes</label>
          </div>

          <div>
            <input
              type="radio"
              value="D"
            />
            <label>D) None of the above</label>
          </div>
        </ul>
      </form>
      <Link to="/myexperience">
        <button>Finish: Trip Experience</button>
      </Link>
    </div>
  );
}

export default Playlist;
